import Table from "./Table";
import Logo from "./components/elements/logo/Logo";
import StaffList from "./components/elements/staffList/StaffList";

const Timetable = () => {
    return(
        <div>
            <div>
                <Logo />
            </div>
            <StaffList />
            <div>
                <Table />
            </div>
        </div>
    )
}
export default Timetable;
